import React from 'react'

const CasestudyProjects = ({ projectData }) => {
    { console.log('00000', projectData) }
    return (
        <>
            <section id="two">
                <div className="inner">
                    <span className="image fit" style={{ marginBottom: '100px' }}><img src="images/splash.svg" alt="" /></span>
                    <div className="box alt">
                        <div className="row gtr-50 gtr-uniform animate__animated animate__zoomIn">
                            {projectData && projectData.map((curElem) => {
                                const { id, name, category, image } = curElem;
                                return <div className="col-4" key={id}><span className="image fit projectimg"><img src={image} alt="images" /></span></div>
                            })}
                        </div>
                    </div>
                </div>
            </section>
        </>
    )
}

export default CasestudyProjects
